export default function Register() {
  return (
    <form className='sing-form'>
      <h2 className='sign-from__title'>Sign up</h2>
      <fieldset>
        <input name='email' type='email' />
        <input name='password' type='password' />
        <button type='submit' />
      </fieldset>
    </form>
  );
}
